import { Genre } from 'type/genre'
import './styles.css'


type Props = {
    genre : Genre[]
}


const GenreFilter = ({genre} : Props) => {




    return (
        <div className="product-filter-container">
           {genre.map((genre) => (
            <select key={genre.id} name="genre" id="genre">
                <option value={genre.name}></option>
            </select>
           ))}
        </div>
    )

}




export default GenreFilter;
